import React from "react";

export default function Button(props) {
  return (
    <div>
      <div className="btn mt-2 flex flex-col space-y-4 md:spy0  md:flex-row justify-center md:space-x-9">
        <div className="flex flex-row md:space-x-9  ">
          <button className="button1 text-xl font-semibold mx-5 text-gray-100  mx-auto p-2  w-1/2 bg-sky-400 hover:bg-sky-500 rounded-2xl">
            {props.first}
          </button>
          <button className="button2 text-xl font-semibold mr-5 text-gray-100 mx-auto p-2  w-1/2 bg-sky-400 hover:bg-sky-500 rounded-2xl ">
            {props.second}
          </button>
        </div>
        <div className="flex flex-row md:space-x-9  ">
          <button className="button1 text-xl font-semibold mx-5 text-gray-100  mx-auto p-2  w-1/2 bg-sky-400 hover:bg-sky-500 rounded-2xl">
            {props.first}
          </button>
          <button className="button2 text-xl font-semibold mr-5 text-gray-100 mx-auto p-2  w-1/2 bg-sky-400 hover:bg-sky-500 rounded-2xl ">
            {props.second}
          </button>
        </div>
      </div>
    </div>
  );
}
